import React from 'react'
import Navigation from './Navigation-ash' 

const Cart = () => {
	let list = [0,1]
	return (
		<div className="cart-page">
			<Navigation colour={"ash"} />
			<div className="cart">
				<div className="desc">
					<h1 className="desc-headers"  >Cover</h1>
					<h1 className="desc-headers"  >Product</h1>
					<h1 className="desc-headers"  >Price</h1>
					<h1 className="desc-headers"  >Quantity</h1>
					<h1 className="desc-headers"  >Subtotal</h1>
				</div>
				{list.map((item)=>{
					return(
					<div className="items">

					</div>
					)
				})}

			</div>
		</div>


	)
}

export default Cart
